import React from 'react'

const Footer = () => {
  var year = new Date().getFullYear();
  return (
    <>
      <footer>
        <p>Copyright {year}</p>
      </footer>
    </>
  )
}


<>
  <footer>
    <p>Copyright {year}</p>
  </footer>
</>
